import React from "react";
import { useState } from "react";
import { useEffect } from "react";
import axios from "axios";
import ResultCard from "../component/ResultCard";

const HasilPengajuan = () => {
  const [hasil, setHasil] = useState([]);

  const fetchHasil = async () => {
    await axios
      .get(`http://localhost:8000/api/data_kematian`)
      .then(({ data }) => {
        setHasil(data);
        
      });
  };

  useEffect(() => {
    fetchHasil();
  }, []);

  const PengajauanSearchResults = props => {
    const [filterPengajuan, setFilterPengajuan] = useState([]);

    async function prepareFilterPengajuan(arrayToBeFiltered, wordparam){
        const filtered = await arrayToBeFiltered.filter((anObject) => {
            return (
                (anObject.nik.toLowerCase().indexOf(wordparam.toLowerCase()) > -1)
            );
        });
        return filtered;
    }
  }

  useEffect(() => {
    prepareFilterPengajuan(hasil, props.word).then((trip) => {
        setFilterPengajuan(trip);
    })
  }, [props.word]);

  console.log(hasil);

  return <div></div>;
};

export default HasilPengajuan;
